import React from "react";
import "./aboutMe.css";

function aboutMe() {
  return (
    <div className="aboutMe">
      <div>
        My love for programming started when I first saw, "Hello World", pop up
        on the screen from a console.log. This newfound excitement for
        programming propelled me into a digital world that I have never left
      </div>
    </div>
  );
}

export default aboutMe;
